  [],\n\t\"revision_timestamp\": \"2015-05-06T21:57:46.218410\",\n\t\"name\": \"radiosonde-cloud-assessment-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Improvements in existing technologies for
  icing weather information systems are required to increase the level of safety for
  aircraft flying in the atmospheric icing environment.  Icing forecasts cannot provide
  the needed accuracy at the present time. Under a NASA sponsored SBIR program, Innovative
  Dynamics, Inc. is developing a Radiosonde Cloud Assessment System (RCLASS) that
  measures liquid water content, drop size, and droplet phase using low-power infrared
  lasers. These parameters would be used to identify certain cloud conditions that
  pose airborne icing hazards to aircraft.  The innovation is a new capability for
  measuring cloud properties that would consist of a small optical probe flown on
  an expendable weather balloon. Phase I demonstrated the feasibility of the IR-based
  approach. A series of tests were conducted in an environmental test chamber to demonstrate
  the overall detection capability. The proposed Phase II will continue development
  and calibration of the sensor package and integrate it into a commercially available
  balloonsonde system for evaluation testing in the atmosphere.\",\n\t\"license_title\":
